import React from 'react'
import { motion } from 'framer-motion';
import styled from 'styled-components';

const firstBox = {
  hidden: { y: "100%" },
  visible: { y: [0, "100%"], duration: 1, delay: 0.5 },
  exit: { y: "100%", transition: { duration: 1 } }
};

const Photos = () => {
  return (
    <StyledPhotos>
        <motion.div 
        className="first-box box" 
        variants={firstBox}
        initial="hidden"
        animate="visible"
        exit="exit"
        transition={{ duration: 0.5 }}
      />
      <motion.div 
        className="second-box box" 
        variants={secondBox}
        initial="hidden"
        animate="visible"
        exit="exit"
        transition={{ duration: 0.5 }}
      />
    </StyledPhotos>
  )
}

const StyledPhotos = styled(motion.div)`
  .box{
    position: absolute;
    width: 50%;
    height: 100px;
    background-color: black;

  }
  .second-box{
    right: 0;
  }
`
export default Photos
